import styled from 'styled-components';

function KatePage () {
    return(
        <Background>
            <TitleWrapper>
                
            </TitleWrapper>
            <YellowStripe><Title>Hi Kate!</Title></YellowStripe>
        </Background>
    );
}

const Background = styled.div`
    height: 100vh;
    width: 100%;
    background: #75D9AF;
    display: flex;
    align-items: center;
    flex-direction: column;

`;

const Title = styled.h1`

    color: #333;
    font-size: 96px;
`;

const  TitleWrapper = styled.div`
    display: flex;
    border-radius: 10%;
    border: 2px solid white;
`;

const YellowStripe = styled.div`
    background: yellow;
    width: 100%;
    height: 20%;
    box-shadow: 0px 5px 4px rgba(0, 0, 0, 0.25);
    display: flex;
    justify-content: center;
`;

export default KatePage;
